{
  "name": "UBX-LOG-RETRIEVE",
  "class_id": "0x21",
  "message_id": "0x09",
  "description": "Request log data",
  "message_type": "command",
  "supported_versions": "u-blox 8/u-blox M8 protocol versions 15, 15.01, 16, 17, 18, 19, 19.1, 19.2, 20, 20.01, 20.1, 20.2, 20.3, 22, 22.01, 23 and 23.01",
  "payload_length": {
    "fixed": 12
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "startNumber",
      "description": "Index of first log entry to be transferred. If it is larger than the index of the last available log entry, then the first log entry to be transferred is the last available log entry. The indexing of log entries is zero-based."
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "entryCount",
      "description": "Number of log entries to transfer in total including the first entry to be transferred. If it is larger than the log entries available starting from the first entry to be transferred, then only the available log entries are transferred followed by a UBX-ACK-NAK. The maximum is 256."
    },
    {
      "byte_offset": 8,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 9,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved1",
      "description": "Reserved",
      "reserved": true
    }
  ]
}
